import {Directive, ElementRef, Renderer2} from '@angular/core';

@Directive({
  selector: '[appCanvas]'
})
export class CanvasDirective {

  constructor(private el: ElementRef, private renderer: Renderer2) {
    this.renderer.setStyle(this.el.nativeElement, 'display', 'flex');
    this.renderer.setStyle(this.el.nativeElement, 'flexDirection', 'column');
    this.renderer.setStyle(this.el.nativeElement, 'width', '100vw');
    this.renderer.setStyle(this.el.nativeElement, 'overflowX', 'hidden');
    this.renderer.setStyle(this.el.nativeElement, 'padding', '8px 24px');
    this.renderer.setStyle(this.el.nativeElement, 'gap', '8px');
    this.renderer.setStyle(this.el.nativeElement, 'alignItems', 'center');
    this.renderer.setStyle(this.el.nativeElement, 'boxSizing', 'border-box');
    this.renderer.setStyle(this.el.nativeElement, 'maxWidth', '100%');
  }
}

import {Directive, ElementRef, Input, OnChanges, Renderer2} from '@angular/core';

@Directive({
  selector: '[appFlex]'
})
export class FlexDirective implements OnChanges {

  @Input() direction: 'row' | 'column' = 'row';
  @Input() align: string = 'start start';

  constructor(private el: ElementRef, private renderer: Renderer2) {
    this.renderer.setStyle(this.el.nativeElement, 'display', 'flex');
    this.renderer.setStyle(this.el.nativeElement, 'flex', '1 1 auto');
    this.renderer.setStyle(this.el.nativeElement, 'width', '100%');
    this.renderer.setStyle(this.el.nativeElement, 'height', '100%');
  }

  ngOnChanges() {
    this.renderer.setStyle(this.el.nativeElement, 'flexDirection', this.direction);
    const [justifyContent, alignItems] = this.align.split(' ');
    this.renderer.setStyle(this.el.nativeElement, 'justifyContent', justifyContent);
    this.renderer.setStyle(this.el.nativeElement, 'alignItems', alignItems);
  }
}

import {Directive, ElementRef, Input, OnChanges, Renderer2} from '@angular/core';

@Directive({
  selector: '[appGrid]'
})
export class GridDirective implements OnChanges {
  @Input() columns: string[] = [];

  constructor(private el: ElementRef, private renderer: Renderer2) {
    this.renderer.setStyle(this.el.nativeElement, 'display', 'grid');
    this.renderer.setStyle(this.el.nativeElement, 'width', '100%');
    this.renderer.setStyle(this.el.nativeElement, 'height', '100%');
  }

  ngOnChanges() {
    this.renderer.setStyle(this.el.nativeElement, 'gridTemplateColumns', this.columns.join(' '));
    this.renderer.setStyle(this.el.nativeElement.children, 'outline', '1px solid red');
  }
}

